import React from 'react'
import { Outlet, Link, useNavigate } from "react-router-dom";
import Home from './components/Home.jsx';
import Grid from "@material-ui/core/Grid";
import {GlobalStyle, StyledButton} from "./components/Style.js"

function App() {

  const navigate = useNavigate()
  const navigateTo = () => {
    navigate("/Home")
  }

  return (
    <>
    <GlobalStyle/>
      <nav>
        <ul>
          <div>
            <Grid container justify="center">
            <StyledButton onClick={navigateTo}>Start Survey</StyledButton>
            </Grid>
          </div>
        </ul>
      </nav>
    </>
  )
}

export default App;
